const Header = lazy(()=>import("./components/LazyLoading/Header"))
import About from './components/LazyLoading/About'


export default function App() {
  return (
    <div>
      <h1>LAzy Loading</h1>
      <Header/>
      <About/>
    </div>
  )
}
